import React from 'react';

class Today extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            Today:(new Date()).toString(),
            Year:(new Date()).getFullYear(),
            Month:(new Date()).getMonth() + 1,
            Day:(new Date()).getDay()
        }
    }
    render() {
        return (
            <div>
                <h2>TUESDAY, APRIL {this.state.Day} {this.state.Year}</h2>
            </div>
        )
    }
}

